import React, { useState } from 'react';
import MainView from './MainView';
import LastMonthView from './LastMonthView';

function App() {
  const [view, setView] = useState('main');

  return (
    <div className="App">
      {view === 'main' ? (
        <MainView setView={setView} />
      ) : view === 'lastMonth' ? (
        <LastMonthView setView={setView} />
      ) : null}
    </div>
  );
}

export default App;
